import React, { Component, Fragment } from 'react';

class List extends Component {

    render() {
		const { button, done, task } = this.props
        return (
        	<Fragment>
	           	<li style = { { backgroundColor : done == 'true' ? 'green' : 'green' } } 
	           		data-done = { done } >
	           		{ task }
	           	</li>
	           	<button onClick = { button } >X</button>
	        </Fragment>
        );
    }
}

export default List;
